const NotoKufiArabicFontBase64 =
  ""; // Replace with your Base64 font string

//const NotoKufiArabicFontBase64 = "AAEAAAAPAIAAAwBw....."; // Replace with your Base64 font string

// Add the font to jsPDF
const { jsPDF } = window.jspdf;

async function ShareDueClientsReportWhatsApp() {
  const clientDebts = await calculateClientDebts();
  const doc = new jsPDF();

  // Add the Arabic font
  doc.addFileToVFS("NotoKufiArabic-Regular.ttf", NotoKufiArabicFontBase64);
  doc.addFont("NotoKufiArabic-Regular.ttf", "NotoKufiArabic", "normal");
  doc.setFont("NotoKufiArabic");

  // Add a title
  doc.setFontSize(18);
  doc.text("تقرير مديونيات العملاء", 105, 20, { align: "center" });

  // Add the table
  const tableData = clientDebts.map((client) => [
    client.lastPaymentDate,
    client.dueAmount.toFixed(2),
    client.name,
  ]);

  let totalPages = 1; // Track total pages

  doc.autoTable({
    head: [["تاريخ آخر سداد", "المبلغ المستحق", "اسم العميل"]],
    body: tableData,
    startY: 30,
    styles: {
      font: "NotoKufiArabic",
      fontStyle: "normal",
      halign: "center", // Center-align text
    },
    headStyles: {
      halign: "center", // Center-align header
    },
    bodyStyles: {
      halign: "center", // Center-align body text
      textDirection: "rtl", // Right-to-left text direction
    },
    didDrawPage: function (data) {
      // Update totalPages if the current page number is greater
      if (data.pageNumber > totalPages) {
        totalPages = data.pageNumber;
      }

      const footerText = `برنامج ع النوتــة - صفحة ${data.pageNumber} من ${totalPages}`;
      const pageSize = doc.internal.pageSize;
      const pageWidth = pageSize.width;
      const pageHeight = pageSize.height;

      // Set font for footer
      doc.setFont("NotoKufiArabic", "normal");
      doc.setFontSize(10);

      // Calculate footer position
      const footerX = pageWidth / 2; // Center horizontally
      const footerY = pageHeight - 10; // 10 units from the bottom

      // Draw a horizontal line above the footer
      doc.setLineWidth(0.5); // Set line thickness
      doc.line(20, footerY - 5, pageWidth - 20, footerY - 5); // Draw line from left to right

      // Add footer text
      doc.text(footerText, footerX, footerY, { align: "center" });
    },
  });

  // Convert the PDF to a Blob
  const pdfBlob = doc.output("blob");

  // Create a File object
  const pdfFile = new File([pdfBlob], "due_clients_report.pdf", {
    type: "application/pdf",
  });

  // Check if the Web Share API is supported
  if (navigator.share) {
    try {
      // Share the PDF file
      await navigator.share({
        title: "تقرير مديونيات العملاء",
        files: [pdfFile],
      });
      console.log("تم مشاركة الملف بنجاح!");
    } catch (error) {
      console.error("حدث خطأ أثناء مشاركة الملف:", error);
      showErrorMessage("حدث خطأ أثناء مشاركة الملف");
    }
  } else {
    // Fallback: Download the PDF and prompt the user to share it manually
    const pdfUrl = URL.createObjectURL(pdfBlob);
    const downloadLink = document.createElement("a");
    downloadLink.href = pdfUrl;
    downloadLink.download = "due_clients_report.pdf";
    document.body.appendChild(downloadLink);
    downloadLink.click();
    document.body.removeChild(downloadLink);

    showErrorMessage("يرجى تحميل الملف ومشاركته يدويًا عبر واتساب");
  }
}

